import Card from "./Card";
import Users from "./users.json";

const Grid = ({ name, lastName, group, picture }) => {
  return (
    <div className="flex flex-wrap justify-center">
      {Users.map((user) => {
        return <div className="text-black">{user.Name}</div>;
      })}
    </div>
  );
};

export default Grid;

